var input = ["", "", "", "", ""];
var keypad = [[1, 2, 3],
							[4, 5, 6],
							[7, 8, 9]]

var row = 1, col = 1,
		result = "",
		current;

function figureOut() {
	for (var i = 0; i < input.length; i++) {
		current = input[i].split('');
		for (var j = 0; j < current.length; j++)
			switch (current[j]) {
				case 'U': if (row - 1 >= 0) row--; break;
				case 'D': if (row + 1 < 3) row++; break;
				case 'R': if (col + 1 < 3) col++; break;
				case 'L': if (col - 1 >= 0) col--; break;
			}

		result += keypad[row][col];
	}
}

function run() {
	figureOut();
	console.log(result);
}

run();




